import React from 'react';
import { useNavigate } from 'react-router-dom';

const HomePage = () => {
  const navigate = useNavigate();
  const token = localStorage.getItem('token');

  const handleLogout = () => {
    localStorage.removeItem('token');
    navigate('/login');
  };

  return (
   <>
  {/* üß≠ Navbar */}
  <nav
  className="navbar navbar-expand-lg position-absolute top-0 w-100"
  style={{
    background: 'transparent',
    boxShadow: 'none',
    border: 'none',
    zIndex: 1000,
  }}
>
  <div className="container d-flex justify-content-between align-items-center">
    <div
      className="px-3 py-1 rounded-3 fw-bold shadow-sm"
      style={{
        backgroundColor: '#00796b',
        color: 'white',
        fontSize: '1.2rem',
      }}
    >
      ü©∫ HealthPredict
    </div>

    <div>
      {token ? (
        <button
          className="px-3 py-1 rounded-3 fw-bold shadow-sm border-0"
          style={{
            backgroundColor: '#00796b',
            color: 'white',
            fontSize: '0.95rem',
          }}
          onClick={handleLogout}
        >
          üîì Logout
        </button>
      ) : (
        <>
          <a
            className="px-3 py-1 rounded-3 fw-bold shadow-sm border-0 me-2"
            style={{
              backgroundColor: '#00796b',
              color: 'white',
              fontSize: '0.95rem',
            }}
            href="/login"
          >
            üîê Login
          </a>
          <a
            className="px-3 py-1 rounded-3 fw-bold shadow-sm border-0"
            style={{
              backgroundColor: '#00796b',
              color: 'white',
              fontSize: '0.95rem',
            }}
            href="/register"
          >
            üìù Register
          </a>
        </>
      )}
    </div>
  </div>
</nav>


  {/* üè† Home Page Content */}
  <div
    style={{
      minHeight: '100vh',
      backgroundImage: "url('/bg.png')",
      backgroundSize: 'cover',
      backgroundRepeat: 'no-repeat',
      backgroundPosition: 'center',
      paddingTop: '80px',
      paddingBottom: '60px',
    }}
  >
    <div className="container">
      <h2 className="text-center mb-5 fw-bold text-dark">Health Prediction Portal</h2>
      <div className="row justify-content-center g-4">
        {/* Diabetes Predictor Card */}
        <div className="col-md-6 col-lg-4">
          <div className="card h-100 shadow border-0">
            <img
              src="https://img.freepik.com/free-vector/diabetes-concept-illustration_114360-3640.jpg?semt=ais_hybrid"
              className="card-img-top"
              alt="Diabetes Predictor"
              style={{ height: '230px', objectFit: 'cover' }}
            />
            <div className="card-body">
              <h5 className="card-title fw-semibold">Diabetes Predictor</h5>
              <p className="card-text">
                Enter your health metrics and check your risk for diabetes.
              </p>
              <a href="/predict" className="btn btn-outline-primary w-100">Try Now</a>
            </div>
          </div>
        </div>

        {/* Heart Disease Predictor Card */}
        <div className="col-md-6 col-lg-4">
          <div className="card h-100 shadow border-0">
            <img
              src="/heart_pic.png"
              className="card-img-top"
              alt="Heart Disease Predictor"
              style={{ height: '230px', objectFit: 'cover' }}
            />
            <div className="card-body">
              <h5 className="card-title fw-semibold">Heart Disease Predictor</h5>
              <p className="card-text">
                Analyze your chances of heart disease based on your inputs.
              </p>
              <a href="/heart" className="btn btn-outline-danger w-100">Predict Now</a>
            </div>
          </div>
        </div>

      </div>
    </div>
  </div>
</>

  );
};

export default HomePage;
